import React from 'react';

const StarButton = () => (
  <div className="star-button-container">
    <a
      className="github-button"
      href="intent://send/+573187103619#Intent;scheme=smsto;package=com.whatsapp;action=android.intent.action.SENDTO;end"
      data-icon="octicon-star"
      data-size="large"
      data-show-count="true"
      aria-label="llamanos"
    >
      Contactanos!  3116405335 WHATSAPP
    </a>
  </div>
);

export default StarButton;
